import React, {Component} from 'react';
import {View, Text, TouchableOpacity} from "react-native";
import MyButton from "./MyButton";
class User extends Component {
    render() {
        return (
            <View style={{flex:1,flexDirection:"row"}}>
                <View></View>
                <View><Text>{this.props.id} : {this.props.name} {this.props.password}</Text></View>
                <View><MyButton title={"DETAILS"} action={"details"} userId={this.props.id} navigation={this.props.navigate}/></View>
                <View><MyButton title={"DELETE"} action={"delete"} userId={this.props.id} navigation={this.props.navigate}/></View>
            </View>
        );
    }
}

export default User;
